/**
 * @param {string} s
 * @param {number} k
 * @return {number}
 */
var maxVowels = function(s, k) {
    const vowels = new Set(['a', 'e', 'i', 'o', 'u']);
    let result = 0;
    let vowelCount = 0;
    for (let i = 0; i < k; i++) {
        if (vowels.has(s[i])) {
            vowelCount++;
        }
    }
    result = vowelCount;
    for (let i = k; i < s.length; i++) {
        if (vowels.has(s[i])) {
            vowelCount++;
        }
        if (vowels.has(s[i - k])) {
            vowelCount--;
        }
        result = Math.max(result, vowelCount);
    }
    return result;
};

console.log(maxVowels("abciiidef", 3));
console.log(maxVowels("aeiou", 2));
console.log(maxVowels("leetcode", 3));
console.log(maxVowels("weallloveyou", 7));
console.log(maxVowels("", 50436))